// ─── Intersection Observer Hook ───
function useReveal(options = {}) {
  const ref = useRef(null);
  const [isVisible, setIsVisible] = useState(false);
  useEffect(() => {
    const el = ref.current;
    if (!el) return;
    const obs = new IntersectionObserver(
      ([entry]) => { if (entry.isIntersecting) { setIsVisible(true); obs.unobserve(el); } },
      { threshold: options.threshold || 0.15, rootMargin: options.rootMargin || "0px" }
    );
    obs.observe(el);
    return () => obs.disconnect();
  // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);
  return [ref, isVisible];
}

// ─── Parallax Hook ───
function useParallax(speed = 0.3) {
  const ref = useRef(null);
  const [offset, setOffset] = useState(0);
  useEffect(() => {
    let ticking = false;
    const onScroll = () => {
      if (!ticking) {
        requestAnimationFrame(() => {
          if (ref.current) {
            const rect = ref.current.getBoundingClientRect();
            const vh = window.innerHeight;
            if (rect.bottom > 0 && rect.top < vh) {
              setOffset((rect.top - vh / 2) * speed);
            }
          }
          ticking = false;
        });
        ticking = true;
      }
    };
    window.addEventListener("scroll", onScroll, { passive: true });
    return () => window.removeEventListener("scroll", onScroll);
  }, [speed]);
  return [ref, offset];
}

// ─── Reveal Wrapper ───
function Reveal({ children, className = "", delay = 0, direction = "up", style = {} }) {
  const [ref, isVisible] = useReveal();
  const transforms = {
    up: "translateY(48px)", down: "translateY(-48px)", left: "translateX(48px)",
    right: "translateX(-48px)", scale: "scale(0.94)", none: "none",
  };
  return (
    <div ref={ref} className={className} style={{
      ...style, opacity: isVisible ? 1 : 0,
      transform: isVisible ? "none" : transforms[direction],
      transition: `opacity 1s cubic-bezier(0.22,1,0.36,1) ${delay}s, transform 1s cubic-bezier(0.22,1,0.36,1) ${delay}s`,
    }}>{children}</div>
  );
}

// ─── Image with lazy load ───
function LazyImg({ src, alt, className = "", style = {} }) {
  const [loaded, setLoaded] = useState(false);
  const [ref, isVisible] = useReveal({ threshold: 0.05 });
  return (
    <div ref={ref} className={`overflow-hidden ${className}`} style={style}>
      {isVisible && (
        <img src={src} alt={alt} onLoad={() => setLoaded(true)} className="w-full h-full object-cover"
          style={{ opacity: loaded ? 1 : 0, transform: loaded ? "scale(1)" : "scale(1.08)",
            transition: "opacity 1.2s ease, transform 1.8s cubic-bezier(0.22,1,0.36,1)", }} />
      )}
    </div>
  );
}

