// ─── Gallery ───
function Gallery() {
  const N = GALLERY_IMAGES.length;
  const GAP = 6;

  // Responsive row height: smaller on mobile
  const [rowH, setRowH] = useState(260);
  useEffect(() => {
    const mq = window.matchMedia("(max-width: 640px)");
    const update = () => setRowH(mq.matches ? 180 : 260);
    update();
    mq.addEventListener("change", update);
    return () => mq.removeEventListener("change", update);
  }, []);
  const COL_H = rowH * 2 + GAP;

  const [lightbox, setLightbox] = useState(null);
  const [columns, setColumns] = useState([]); // built after preload: [{ type, src?, aspect?, topSrc?, botSrc?, topAspect?, botAspect? }]
  const [ready, setReady] = useState(false);
  const [isDragging, setIsDragging] = useState(false);
  const scrollRef = useRef(null);
  const dragStart = useRef({ x: 0, scrollLeft: 0 });

  // Phase 1: preload all 21 images → detect aspect ratio + orientation → build column groups
  useEffect(() => {
    const detected = {}; // { i: { portrait: bool, aspect: w/h } }
    let loaded = 0;
    GALLERY_IMAGES.forEach((src, i) => {
      const img = new Image();
      const done = () => {
        loaded++;
        if (loaded !== N) return;

        // Build column groups in image order.
        // Portrait images → own full-height column (width = COL_H × aspect, capped).
        // Landscape images → paired two-per-column (width = max natural width of pair at rowH, capped).
        // If a landscape has no pair (interrupted by portrait / odd count), stretch it to full height.
        const cols = [];
        let pending = null; // unpaired landscape: { src, aspect }

        for (let j = 0; j < N; j++) {
          const d = detected[j] || { portrait: false, aspect: 4 / 3 };
          if (d.portrait) {
            if (pending) {
              // Flush unpaired landscape as a full-height stretched column
              cols.push({ type: "portrait", src: GALLERY_IMAGES[pending.idx], aspect: pending.aspect });
              pending = null;
            }
            cols.push({ type: "portrait", src: GALLERY_IMAGES[j], aspect: d.aspect });
          } else {
            if (pending) {
              // Pair with pending landscape
              cols.push({ type: "pair", topSrc: GALLERY_IMAGES[pending.idx], topAspect: pending.aspect, botSrc: GALLERY_IMAGES[j], botAspect: d.aspect });
              pending = null;
            } else {
              pending = { idx: j, aspect: d.aspect };
            }
          }
        }
        if (pending) {
          cols.push({ type: "portrait", src: GALLERY_IMAGES[pending.idx], aspect: pending.aspect });
        }

        setColumns(cols);
        setReady(true);
      };
      img.onload = () => {
        detected[i] = { portrait: img.naturalHeight > img.naturalWidth * 1.1, aspect: img.naturalWidth / img.naturalHeight };
        done();
      };
      img.onerror = () => { detected[i] = { portrait: false, aspect: 4 / 3 }; done(); };
      img.src = src;
    });
  }, []); // eslint-disable-line react-hooks/exhaustive-deps

  // Phase 2: jump to copy 2 once layout is ready
  useEffect(() => {
    if (!ready || !scrollRef.current) return;
    requestAnimationFrame(() => {
      if (scrollRef.current) scrollRef.current.scrollLeft = scrollRef.current.scrollWidth / 3;
    });
  }, [ready]);

  // Phase 3: infinite loop
  useEffect(() => {
    const el = scrollRef.current;
    if (!el) return;
    const onScroll = () => {
      const third = el.scrollWidth / 3;
      if (el.scrollLeft >= third * 2) el.scrollLeft -= third;
      else if (el.scrollLeft < third) el.scrollLeft += third;
    };
    el.addEventListener("scroll", onScroll, { passive: true });
    return () => el.removeEventListener("scroll", onScroll);
  }, []);

  // Column width from natural aspect ratio — portrait and landscape scale differently
  const colWidth = (col) => {
    const isMobile = rowH === 180;
    if (col.type === "portrait") {
      // Full-height portrait: width = COL_H × (w/h), clamped to feel editorial not extreme
      return Math.min(isMobile ? 300 : 440, Math.max(isMobile ? 150 : 190, Math.round(COL_H * col.aspect)));
    }
    // Landscape pair: each image fills rowH, column takes the wider of the two
    const w1 = Math.round(rowH * col.topAspect);
    const w2 = Math.round(rowH * col.botAspect);
    return Math.min(isMobile ? 400 : 580, Math.max(isMobile ? 200 : 260, Math.max(w1, w2)));
  };

  // Height split fractions for pair columns — top image gets this fraction of available height.
  // Cycles across columns so consecutive pairs look clearly different.
  const SPLITS = [0.58, 0.38, 0.65, 0.45, 0.70, 0.42, 0.55, 0.33, 0.62, 0.48];

  // Triple columns for seamless infinite loop
  const allCols = [...columns, ...columns, ...columns];

  const btnStyle = {
    background: "none", border: `1px solid ${C.fog}`, color: C.ink,
    width: 44, height: 44, cursor: "pointer", fontSize: rem(18), lineHeight: 1,
    display: "flex", alignItems: "center", justifyContent: "center",
    transition: "border-color 0.2s", fontFamily: "var(--fb)",
  };

  const overlay = {
    position: "absolute", inset: 0, background: "rgba(0,0,0,0)",
    transition: "background 0.4s", pointerEvents: "none",
  };

  return (
    <section id="gallery" style={{ background: C.cream, padding: "clamp(5rem, 10vw, 8.75rem) 0" }}>
      <div className="max-w-7xl mx-auto px-6 md:px-10">
        <div style={{ display: "flex", justifyContent: "space-between", alignItems: "flex-end" }}>
          <Reveal>
            <p className="fb" style={{ fontSize: rem(11), letterSpacing: "0.2em", textTransform: "uppercase", color: C.driftwood, marginBottom: 16 }}>Gallery</p>
            <h2 className="fd" style={{ fontSize: "clamp(2.25rem, 5vw, 3.75rem)", fontWeight: 300, lineHeight: 1.1, color: C.ink }}>Moments captured</h2>
          </Reveal>
          <div style={{ display: "flex", gap: 10, paddingBottom: 4 }}>
            <button style={btnStyle}
              onMouseEnter={e => e.currentTarget.style.borderColor = C.ink}
              onMouseLeave={e => e.currentTarget.style.borderColor = C.fog}
              onClick={() => scrollRef.current?.scrollBy({ left: -700, behavior: "smooth" })}>←</button>
            <button style={btnStyle}
              onMouseEnter={e => e.currentTarget.style.borderColor = C.ink}
              onMouseLeave={e => e.currentTarget.style.borderColor = C.fog}
              onClick={() => scrollRef.current?.scrollBy({ left: 700, behavior: "smooth" })}>→</button>
          </div>
        </div>
      </div>

      {/* Flex track — each column has a naturally derived width from aspect ratio */}
      <div
        ref={scrollRef}
        className="gallery-track"
        style={{
          display: "flex", gap: GAP, alignItems: "stretch",
          height: COL_H, overflowX: "auto", marginTop: 40,
          cursor: isDragging ? "grabbing" : "grab", userSelect: "none",
          opacity: ready ? 1 : 0, transition: "opacity 0.4s ease",
        }}
        onMouseDown={e => { setIsDragging(true); dragStart.current = { x: e.pageX, scrollLeft: scrollRef.current.scrollLeft }; }}
        onMouseMove={e => { if (!isDragging) return; scrollRef.current.scrollLeft = dragStart.current.scrollLeft - (e.pageX - dragStart.current.x); }}
        onMouseUp={() => setIsDragging(false)}
        onMouseLeave={() => setIsDragging(false)}
      >
        {allCols.map((col, i) => {
          const w = colWidth(col);
          if (col.type === "portrait") {
            return (
              <div key={i} style={{ width: w, height: COL_H, flexShrink: 0, position: "relative", overflow: "hidden", cursor: "pointer" }}
                onClick={() => { if (!isDragging) setLightbox(col.src); }}>
                <img src={col.src} alt="Gallery" style={{ width: "100%", height: "100%", objectFit: "cover", display: "block", pointerEvents: "none" }} />
                <div style={overlay} onMouseEnter={e => e.currentTarget.style.background = "rgba(0,0,0,0.08)"} onMouseLeave={e => e.currentTarget.style.background = "rgba(0,0,0,0)"} />
              </div>
            );
          }
          const frac = SPLITS[(i % columns.length) % SPLITS.length];
          const available = COL_H - GAP;
          const topH = Math.round(available * frac);
          const botH = available - topH;
          return (
            <div key={i} style={{ width: w, height: COL_H, flexShrink: 0, display: "flex", flexDirection: "column", gap: GAP }}>
              {[{ src: col.topSrc, h: topH }, { src: col.botSrc, h: botH }].map((img, j) => (
                <div key={j} style={{ width: "100%", height: img.h, position: "relative", overflow: "hidden", cursor: "pointer", flexShrink: 0 }}
                  onClick={() => { if (!isDragging) setLightbox(img.src); }}>
                  <img src={img.src} alt="Gallery" style={{ width: "100%", height: "100%", objectFit: "cover", display: "block", pointerEvents: "none" }} />
                  <div style={overlay} onMouseEnter={e => e.currentTarget.style.background = "rgba(0,0,0,0.08)"} onMouseLeave={e => e.currentTarget.style.background = "rgba(0,0,0,0)"} />
                </div>
              ))}
            </div>
          );
        })}
      </div>

      {lightbox && (
        <div className="lb-overlay" onClick={() => setLightbox(null)}>
          <img src={lightbox} alt="Gallery fullscreen" />
          <button onClick={() => setLightbox(null)} style={{ position: "absolute", top: 24, right: 24, background: "none", border: "none", color: "#fff", fontSize: rem(32), cursor: "pointer", fontFamily: "var(--fb)" }}>✕</button>
        </div>
      )}
    </section>
  );
}

